The '''Continued Fraction Algorithm''' is a method for finding the continued fraction expansion for any irrational number to as many partial quotients as desired.
Let $x_0$ be the irrational number in question.
The steps are:
{{begin-eqn}}
{{eqn | n = 1
      | l = k
      | r = 0
      | c = initialise
}}
{{eqn | n = 2
      | l = a_k
      | r = \floor {x_k}
      | c = the $k$th partial quotient (that is, $a_k$) is the integer part of $x_k$
}}
{{eqn | n = 3
      | l = x_{k + 1}
      | r = \frac 1 {x_k - a_k}
      | c = the subsequent term is the reciprocal of the fractional part of $x_k$
}}
{{eqn | n = 4
      | l = k
      | r = k + 1
      | c = increase $k$ by $1$ then go to step $(2)$
}}
{{end-eqn}}
Then $x_0 = \sqbrk {a_0, a_1, a_2, \ldots}$ is the required continued fraction expansion.

