{{axiom | n = \text {PI} 1
        | lc= Self-Inverse Property
        | q = \forall x \in G
        | m = x \oplus x = e
}}
{{axiom | n = \text {PI} 2
        | lc= Right Identity
        | q = \exists e \in G: \forall x \in G
        | m = x \oplus e = x
}}
{{axiom | n = \text {PI} 3
        | lc= Product Inverse with Right Identity
        | q = \forall x, y \in G
        | m = e \oplus \paren {x \oplus y} = y \oplus x
}}
{{axiom | n = \text {PI} 4
        | lc= Cancellation Property
        | q = \forall x, y, z \in G
        | m = \paren {x \oplus z} \oplus \paren {y \oplus z} = x \oplus y
}}
{{end-axiom}}
These four stipulations are known as the '''product inverse operation axioms'''.
Let $\circ$ be the operation on $G$ defined as:
:$\forall x, y \in G: x \circ y = x \oplus \paren {e \oplus y}$
Then:
:$\forall x, y, z \in G: x \oplus z = y \oplus z \implies x = y$

